export const fetchAPI = () => fetch('https://opentdb.com/api_token.php?command=request')
  .then((data) => data.json())
  .then((response) => response);

export const putTokenInLocalStorage = () => {
  const token = fetchAPI().then((response) => console.log(response));
  ;
};
